import React from 'react'

function VideoCards({ info }) {
    console.log(info);
    const { snippet, statistics } = info;
    const { thumbnails, channelTitle, title } = snippet;
    return (
        <div>
            <img src={thumbnails?.high} />
        </div>
    )
}

export default VideoCards
